    assertArrayEquals(array3a, array3b);
    // tests
    boolean[] array = { false, false, true, true };
    ArrayUtils.swap(array, 0, 2, 2);
    assertTrue(array[0]);
    assertTrue(array[1]);
    assertFalse(array[2]);
    assertFalse(array[3]);
    array = new boolean[] { false, true, false };
    ArrayUtils.swap(array, 0, 3);
    assertFalse(array[0]);
    assertTrue(array[1]);
    assertFalse(array[2]);
    array = new boolean[] { true, true, false };
    ArrayUtils.swap(array, 0, 2, 2);
    assertFalse(array[0]);
    assertTrue(array[1]);
    assertTrue(array[2]);
    array = new boolean[] { true, true, false };
    ArrayUtils.swap(array, -1, 2, 2);
    assertFalse(array[0]);
    assertTrue(array[1]);
    assertTrue(array[2]);
    array = new boolean[] { true, true, false };
    ArrayUtils.swap(array, 0, -1, 2);
    assertTrue(array[0]);
    assertTrue(array[1]);
    assertFalse(array[2]);
    array = new boolean[] { true, true, false };
    ArrayUtils.swap(array, -1, -1, 2);
    assertTrue(array[0]);
    assertTrue(array[1]);
    assertFalse(array[2]);
}

