@Test
void test_IS_OS() {
    final String osName = System.getProperty("os.name");
    if (osName == null) {
        assertFalse(SystemUtils.IS_OS_WINDOWS);
        assertFalse(SystemUtils.IS_OS_UNIX);
        assertFalse(SystemUtils.IS_OS_SOLARIS);
        assertFalse(SystemUtils.IS_OS_LINUX);
        assertFalse(SystemUtils.IS_OS_MAC_OSX);
        assertFalse(SystemUtils.IS_OS_NETWARE);
    } else if (osName.startsWith("Windows")) {
        assertTrue(SystemUtils.IS_OS_WINDOWS);
        assertFalse(SystemUtils.IS_OS_ANDROID);
        assertFalse(SystemUtils.IS_OS_UNIX);
        assertFalse(SystemUtils.IS_OS_NETWARE);
    } else if (osName.startsWith("Solaris")) {
        assertTrue(SystemUtils.IS_OS_SOLARIS);
        assertTrue(SystemUtils.IS_OS_UNIX);
        assertFalse(SystemUtils.IS_OS_ANDROID);
        assertFalse(SystemUtils.IS_OS_WINDOWS);
        assertFalse(SystemUtils.IS_OS_NETWARE);
    } else if (osName.toLowerCase(Locale.ENGLISH).startsWith("linux")) {
        assertTrue(SystemUtils.IS_OS_LINUX);
        assertTrue(SystemUtils.IS_OS_UNIX);
        assertFalse(SystemUtils.IS_OS_WINDOWS);
        assertFalse(SystemUtils.IS_OS_NETWARE);
    } else if (osName.startsWith("Mac OS X")) {
        assertTrue(SystemUtils.IS_OS_MAC_OSX);
        assertTrue(SystemUtils.IS_OS_UNIX);
        assertFalse(SystemUtils.IS_OS_ANDROID);
        assertFalse(SystemUtils.IS_OS_WINDOWS);
        assertFalse(SystemUtils.IS_OS_NETWARE);
        // @formatter:off
        final boolean[] macOsValues = { SystemUtils.IS_OS_MAC_OSX_BIG_SUR, SystemUtils.IS_OS_MAC_OSX_CATALINA, SystemUtils.IS_OS_MAC_OSX_CHEETAH, SystemUtils.IS_OS_MAC_OSX_EL_CAPITAN, SystemUtils.IS_OS_MAC_OSX_HIGH_SIERRA, SystemUtils.IS_OS_MAC_OSX_JAGUAR, SystemUtils.IS_OS_MAC_OSX_LEOPARD, SystemUtils.IS_OS_MAC_OSX_LION, SystemUtils.IS_OS_MAC_OSX_MAVERICKS, SystemUtils.IS_OS_MAC_OSX_MOJAVE, SystemUtils.IS_OS_MAC_OSX_MONTEREY, SystemUtils.IS_OS_MAC_OSX_MOUNTAIN_LION, SystemUtils.IS_OS_MAC_OSX_PANTHER, SystemUtils.IS_OS_MAC_OSX_PUMA, SystemUtils.IS_OS_MAC_OSX_SEQUOIA, SystemUtils.IS_OS_MAC_OSX_SIERRA, SystemUtils.IS_OS_MAC_OSX_SNOW_LEOPARD, SystemUtils.IS_OS_MAC_OSX_SONOMA, SystemUtils.IS_OS_MAC_OSX_TIGER, SystemUtils.IS_OS_MAC_OSX_VENTURA, SystemUtils.IS_OS_MAC_OSX_YOSEMITE };
        // @formatter:on
        if (BooleanUtils.or(macOsValues)) {
            // If one is true, then only one should be true.
            assertTrue(BooleanUtils.xor(macOsValues));
        }
    } else if (osName.startsWith("OS/2")) {
        assertTrue(SystemUtils.IS_OS_OS2);
        assertFalse(SystemUtils.IS_OS_UNIX);
        assertFalse(SystemUtils.IS_OS_ANDROID);
        assertFalse(SystemUtils.IS_OS_WINDOWS);
        assertFalse(SystemUtils.IS_OS_NETWARE);
    } else if (osName.startsWith("SunOS")) {
        assertTrue(SystemUtils.IS_OS_SUN_OS);
        assertTrue(SystemUtils.IS_OS_UNIX);
        assertFalse(SystemUtils.IS_OS_ANDROID);
        assertFalse(SystemUtils.IS_OS_WINDOWS);
        assertFalse(SystemUtils.IS_OS_NETWARE);
    } else if (osName.startsWith("FreeBSD")) {
        assertTrue(SystemUtils.IS_OS_FREE_BSD);
        assertTrue(SystemUtils.IS_OS_UNIX);
        assertFalse(SystemUtils.IS_OS_ANDROID);
        assertFalse(SystemUtils.IS_OS_WINDOWS);
        assertFalse(SystemUtils.IS_OS_NETWARE);
    } else {
        System.err.println("Can't test IS_OS_ value: " + osName);
    }
}

