    sb.setNullText("NULL").append((StringBuffer) null, 0, 1);
    assertEquals("NULL", sb.toString());
    sb = new StrBuilder();
    sb.append(new StringBuffer("foo"), 0, 3);
    assertEquals("foo", sb.toString());
    final StrBuilder sb1 = sb;
    assertIndexOutOfBoundsException(() -> sb1.append(new StringBuffer("bar"), -1, 1), "append(char[], -1,) expected IndexOutOfBoundsException");
    assertIndexOutOfBoundsException(() -> sb1.append(new StringBuffer("bar"), 3, 1), "append(char[], 3,) expected IndexOutOfBoundsException");
    assertIndexOutOfBoundsException(() -> sb1.append(new StringBuffer("bar"), 1, -1), "append(char[],, -1) expected IndexOutOfBoundsException");
    assertIndexOutOfBoundsException(() -> sb1.append(new StringBuffer("bar"), 1, 3), "append(char[], 1, 3) expected IndexOutOfBoundsException");
    assertIndexOutOfBoundsException(() -> sb1.append(new StringBuffer("bar"), -1, 3), "append(char[], -1, 3) expected IndexOutOfBoundsException");
    assertIndexOutOfBoundsException(() -> sb1.append(new StringBuffer("bar"), 4, 0), "append(char[], 4, 0) expected IndexOutOfBoundsException");
    sb.append(new StringBuffer("bar"), 3, 0);
    assertEquals("foo", sb.toString());
    sb.append(new StringBuffer("abcbardef"), 3, 3);
    assertEquals("foobar", sb.toString());
}

