void testLexx() {
    // tests each constant
    assertArrayEquals(new DurationFormatUtils.Token[] { createTokenWithCount(DurationFormatUtils.y, 1), createTokenWithCount(DurationFormatUtils.M, 1), createTokenWithCount(DurationFormatUtils.d, 1), createTokenWithCount(DurationFormatUtils.H, 1), createTokenWithCount(DurationFormatUtils.m, 1), createTokenWithCount(DurationFormatUtils.s, 1), createTokenWithCount(DurationFormatUtils.S, 1) }, DurationFormatUtils.lexx("yMdHmsS"));
    // tests the ISO 8601-like
    assertArrayEquals(new DurationFormatUtils.Token[] { createTokenWithCount(DurationFormatUtils.H, 2), createTokenWithCount(new StringBuilder(":"), 1), createTokenWithCount(DurationFormatUtils.m, 2), createTokenWithCount(new StringBuilder(":"), 1), createTokenWithCount(DurationFormatUtils.s, 2), createTokenWithCount(new StringBuilder("."), 1), createTokenWithCount(DurationFormatUtils.S, 3) }, DurationFormatUtils.lexx("HH:mm:ss.SSS"));
    // test the iso extended format
    assertArrayEquals(new DurationFormatUtils.Token[] { createTokenWithCount(new StringBuilder("P"), 1), createTokenWithCount(DurationFormatUtils.y, 4), createTokenWithCount(new StringBuilder("Y"), 1), createTokenWithCount(DurationFormatUtils.M, 1), createTokenWithCount(new StringBuilder("M"), 1), createTokenWithCount(DurationFormatUtils.d, 1), createTokenWithCount(new StringBuilder("DT"), 1), createTokenWithCount(DurationFormatUtils.H, 1), createTokenWithCount(new StringBuilder("H"), 1), createTokenWithCount(DurationFormatUtils.m, 1), createTokenWithCount(new StringBuilder("M"), 1), createTokenWithCount(DurationFormatUtils.s, 1), createTokenWithCount(new StringBuilder("."), 1), createTokenWithCount(DurationFormatUtils.S, 3), createTokenWithCount(new StringBuilder("S"), 1) }, DurationFormatUtils.lexx(DurationFormatUtils.ISO_EXTENDED_FORMAT_PATTERN));
    // test failures in equals
    final DurationFormatUtils.Token token = createTokenWithCount(DurationFormatUtils.y, 4);
    assertEquals(token, token);
    assertEquals(token.hashCode(), token.hashCode());
    assertNotEquals(token, new Object(), "Token equal to non-Token class.");
    final Token token2 = createTokenWithCount("", 1);
    assertNotEquals(token, token2, "Token equal to Token with wrong value class.");
    assertNotEquals(token.hashCode(), token2.hashCode());
    assertNotEquals(token, createTokenWithCount(DurationFormatUtils.y, 1), "Token equal to Token with different count.");
    final DurationFormatUtils.Token numToken = createTokenWithCount("1", 4);
    assertEquals(numToken, numToken, "Token with Number value not equal to itself.");
}

